import logo from './logo.svg';
import './App.css';
import Header from './component/Header';
import Container from './component/Container';
import Footer from './component/Footer';

function App() {
  return (
    <div className="container">
      <div class="row">
        <div class="col-12">
        <Header/>
      <Container/>
      <Footer/>
        </div>
      </div>

    </div>
  );
}

export default App;
